Hmm and in your js you need quotes? Curious why you can’t do:
`const pie = { callback: {{ module.callback }} };` and have it output :point_down::skin-tone-2:
```callback: function pie () {
  window.alert('test');
  }
  pie();
}```
If that is not possible with your js code, then I’d use a hubl regex replace filter to strip new lines `\\n`
